import React from 'react';

const Item = ({ item }) => {
    return (
        <div className="bg-white p-4 rounded shadow-md">
            <h2 className="text-xl font-bold mb-2">{item.title}</h2>
            <p className="text-gray-700 mb-2">{item.description}</p>
            <p className="text-gray-700 mb-2"><strong>Category:</strong> {item.category}</p>
            <p className="text-gray-700 mb-2"><strong>Condition:</strong> {item.condition}</p>
            <p className="text-gray-700 mb-2"><strong>Location:</strong> {item.location}</p>
            <p className="text-gray-700 mb-2"><strong>Price:</strong> ${item.price.toFixed(2)}</p>
        </div>
    );
};

export default Item;
